def get_paras_for_modelling(row):
	desired_paras = []

	for para in row["croppedCaption"]:
		if para[3]:
			annotation = row[str(para[2])]
			if annotation == "True" or annotation == True or pd.isna(annotation):
				desired_paras.extend(para[0].split("[LINE BREAK]"))
			elif annotation != "False" and annotation != False:
				desired_paras.extend(annotation.split("[LINE BREAK]"))

		else:
			annotation = row[str(para[2])]
			if annotation == "True" or annotation == True:
				desired_paras.extend(para[0].split("[LINE BREAK]"))
			elif annotation != "False" and annotation != False and annotation != "Undecided" and not pd.isna(
					annotation):
				desired_paras.extend(annotation.split("[LINE BREAK]"))

	for i in range(len(desired_paras)):
		desired_paras[i] = desired_paras[i].replace("\xa0", " ").replace("&amp;", "&").replace(". (Report)", ".")
		desired_paras[i] = re.sub(r"^\d+[\.\]]?\s?([A-Z])", r"\1", desired_paras[i])
		desired_paras[i] = re.sub(r"\s+", r" ", desired_paras[i])
		desired_paras[i] = re.sub(r"\.\d+$", r".", desired_paras[i])
		desired_paras[i] = desired_paras[i].strip()

	return "\n".join(desired_paras)


