def assign_chart_types(id):
	if id in bar:
		return "bar"

	if id in pie:
		return "pie"

	if id in simple_line or id in multiple_line:
		return "line"

	if id in simple_area or id in multiple_area:
		return "area"

	if id in scatter_plots:
		return "scatter"

	print(id)


def assign_complexity(id):
	if id in pie or id in simple_line or id in simple_area:
		return "simple"

	if id in multiple_line or id in multiple_area or id in scatter_plots:
		return "complex"

	if id in bar:
		if id in simple_bar:
			return "simple"
		else:
			return "complex"

	print(id)
	return "complex"


def assign_chart_topic(url):
	return full_meta_df.loc[full_meta_df["URL"] == url, "topic"].values[0]


def fix_title(title):
	if type(title) != str:
		return ""

	if "_" in title or re.match(r"-\d\d+", title) is not None or re.match(r"^Figure(?: \d+)?$", title):
		print("remove", title)
		return ""

	if re.match(r'(?:A )?(?:[Ll]ine |[Pp]ie )?[Cc]harts?(?: that shows| shows| showing(?: that| how|)| of|:) ',
				title) is not None:
		title = re.sub(r'(?:A )?(?:[Ll]ine |[Pp]ie )?[Cc]harts?(?: that shows| shows| showing(?: that| how|)| of|:) ',
					   '', title)

		if len(title) != 0:
			title = title[0].upper() + title[1:]

	if "chart" in title:
		print("remove", title)
		return ""

	return title.strip()


def add_titles(row):
	id = row["id"]
	alt_text = row["title"]
	ocr_title = ocr_metadata.loc[id, "ocr_title"]
	titles = []

	if alt_text != "":
		titles.append(alt_text)

	if ocr_title != "" and type(ocr_title) == str:
		titles.append(ocr_title)

	if len(titles) == 0:
		return ocr_metadata.loc[id, "ocr_first_line"]

	return max(titles, key=len)


if __name__ == "__main__":
	annotation_results = pd.read_csv(NO_DATA_DIR + "for_annotation/annotated_charts.csv").set_index("id")
	long_annotation_results = pd.read_csv(NO_DATA_DIR + "for_annotation/long_annotated_charts.csv").set_index("id")
	combined_annotation_results = pd.concat([annotation_results, long_annotation_results])

	cropped_meta_df = pd.read_csv(NO_DATA_DIR + CROPPED_META_FILTERED_PATH, converters={"caption": literal_eval, "croppedCaption": literal_eval})
	cropped_meta_df.set_index("id", inplace=True)

	ocr_metadata = pd.read_csv(NO_DATA_DIR + "ocr_metadata.csv").set_index("id")

	cropped_meta_df.loc[combined_annotation_results.index, combined_annotation_results.columns] = combined_annotation_results

	# Clean paragraphs
	cropped_meta_df["caption"] = cropped_meta_df.apply(get_paras_for_modelling, axis=1)

	cropped_meta_df = cropped_meta_df.drop(["croppedCaption", "parasWithScores", "sentencesWithScores"] + [str(i) for i in range(-5, 6)], axis=1)
	cropped_meta_df["dataPath"] = cropped_meta_df["imgPath"].str.replace("imgs", "data").str.replace(".png", ".csv")
	cropped_meta_df = cropped_meta_df[cropped_meta_df["caption"] != ""]

	# Add chart type & complexity
	cropped_meta_df.reset_index(inplace=True)
	cropped_meta_df["chartType"] = cropped_meta_df["id"].apply(assign_chart_types)
	cropped_meta_df["complexity"] = cropped_meta_df["id"].apply(assign_complexity)
	cropped_meta_df.set_index("id", inplace=True)

	# Assign chart topic
	full_meta_df = pd.read_csv(NO_DATA_DIR + META_NO_DUPLICATES_PATH)
	cropped_meta_df["topic"] = cropped_meta_df["URL"].apply(assign_chart_topic)

	# Fix titles
	cropped_meta_df["title"] = cropped_meta_df["title"].apply(fix_title)
	cropped_meta_df.reset_index(inplace=True)
	cropped_meta_df["title"] = cropped_meta_df.apply(add_titles, axis=1)
	cropped_meta_df.set_index("id", inplace=True)

	# Change gatpath
	cropped_meta_df["dataPath"] = cropped_meta_df["dataPath"].str.replace(".csv", ".txt")

	# No OCR tokens
	cropped_meta_df.drop(12266, inplace=True)

	# Save
	cropped_meta_df.to_csv(NO_DATA_DIR + "final_metadata.csv")

	# Separate into simple and complex
	cropped_meta_df.reset_index(inplace=True)

	simple_df = cropped_meta_df[cropped_meta_df["complexity"] == "simple"].reset_index()
	simple_df["id"] = simple_df["id"].apply(lambda x: f"no_data-{x}")
	simple_df.to_csv(NO_DATA_DIR + "simple_metadata.csv", index=False)

	complex_df = cropped_meta_df[cropped_meta_df["complexity"] == "complex"].reset_index()
	complex_df["id"] = complex_df["id"].apply(lambda x: f"no_data-{x}")
	complex_df.to_csv(NO_DATA_DIR + "complex_metadata.csv", index=False)
